import React from 'react';
import Header from './components/header/Header';
import Progetto from './components/progetto/Progetto';
import Storia from './components/storia/Storia';
import Servizi from './components/servizi/Servizi';
import SoluzioniAbitative from './components/soluzioni-abitative/Soluzioni-abitative';
import Contatti from './components/contatti/Contatti';
import Footer from './components/footer/Footer';
import { Element } from 'react-scroll';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='header' id='header'>
        <Header />
      </div>
      <div className='progetto' id='progetto'>
        <Progetto />
      </div>
      <div className='storia' id='storia'>
        <Storia />
      </div>
      <div className='servizi' id='servizi'>
        <Servizi />
      </div>
      <div className='soluzioni-abitative' id='soluzioni-abitative'>
        <SoluzioniAbitative />
      </div>
      <div className='contatti' id='contatti'>
        <Contatti />
      </div>
      <div className='footer' id='footer'>
        <Footer />
      </div>
    </div>
  );
}

export default App;
